import React from "react";
import "./home.scss";
import main from "../../assets/main.png";
import laptop from "../../assets/laptop.png";

const Home = () => {
  return (
    <section className="home">
      <div className="showcase">
        <div className="title">
          <h1>R4 Resources</h1>
          <p>Responsive <span><img src={laptop} alt="laptop icon"/></span> Resourceful Reliable Reasonable</p>
        </div>
        <img src={main} alt="main image" />
      </div>
    </section>
  );
};

export default Home;
